sys_variable_value.value:
(function execute(inputs, outputs) {
  if (inputs.status_code == '201') {
    outputs.status = "Success";
    var response =  JSON.parse(inputs.response)
    outputs.user_id = response['id'];
    outputs.user_info = inputs.response;
    outputs.user_details_1 = response;
  } else {
    outputs = new BoxErrorHandler().createUserErrorHandler(inputs, outputs);
  }
})(inputs, outputs);

